import React from "react"; 
import Navbar from 'react-bootstrap/Navbar' 

const navbar = props => {
  return (
    <div>
       <Navbar bg="dark" variant="dark">
       <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>

       </Navbar>
    </div>
  )
}

export default navbar
